import React from 'react'

const ButtonRRR = ({numbers, buttonclick}) => {
  return (
    <div className="buttonstyle">{
        numbers.map((num) => {
            return(
        <button className="buttons" key={num} onClick={() => buttonclick(num)}>{num}</button>
    )
        })
    }
    </div>
  )
}

export default ButtonRRR
